import React from 'react'
import "./Filter.css"
const Filter = () => {
  return (
    <div className='Filter d__flex align__itmes__center'>
        <div className='Filter__container'>
            <div className='Filter_item'></div>
        </div>
    </div>
  )
}

export default Filter
